Taj Mahal is a 1963 film based on the historical legend of the Mughal emperor Shah Jahan who created the Taj Mahal in fond remembrance and as a tomb for his beloved wife Mumtaz Mahal. It was a commercial and critical hit, but is remembered most for its melodious music.

